import axios from "axios";

const api = axios.create({
    baseURL: "http://localhost:3000/api"
})

export const createNote = data => api.post(`/note`, data)
export const deleteNote = id => api.delete(`/note/${id}`)
//export const retrieveNote = 
//updateNote

const apis = {
    createNote,
    deleteNote
}

export default apis
